import React from "react";
import Navigation from '../Navigation/Navigation.js';
import './Home.css';

const Home = () => {
  return (
    <div>
      <Navigation />
      <div class="container" id="greencontainer">
        <div id="heading2" class="heading">
          <svg id="slant" class="slant" viewBox="0 0 1 1" preserveAspectRatio="none">
            <polygon points="0,1 1,1 1,0" />
          </svg>
        </div>
        <div class="cover">
        </div>
      </div>
      <div class="container">
        <div id="heading3" class="heading">
          <svg id="thirdslant" class="slant" viewBox="0 0 1 1" preserveAspectRatio="none">
            <polygon points="0,1 1,1 1,0" />
          </svg>
        </div>
        </div>
    </div>
  );
};

export default Home;
